import { Component, Input, OnInit, Output } from "@angular/core";
import { ToDo } from "src/app/todo.model";
import { HttpClient } from "@angular/common/http";
@Component({
  selector: "app-todo",
  templateUrl: "./todo.component.html",
  styleUrls: ["./todo.component.css"],
})
export class TodoComponent implements OnInit {
  addTodo(e: string) {
    //JAG VILL ATT EVENTET SKA PUSHAS IN I TODOLISTEN
    this.useridList.push({ userId: 4, id: 4, title: e, completed: false });
    console.log(this.useridList);

    console.log(e);
  }

  toDoList!: ToDo[];

  useridList!: ToDo[];

  constructor(private http: HttpClient) {}
  //KÖR METODEN UTAN ETT KLICK
  ngOnInit() {
    this.fetchToDo();
  }

  fetchToDo() {
    this.http
      .get<ToDo[]>("https://jsonplaceholder.typicode.com/todos")
      .subscribe((res: ToDo[]) => {
        this.toDoList = res;
        this.useridList = this.toDoList.filter(
          (x) => x.userId === 4 && x.completed === false
        );
        console.log(this.useridList);
      });
  }
}
<div class="todo-container">
  <input #inputValue />
  <app-button
    [skickaIn]="inputValue"
    (btnClicked)="addTodo($event)"
  ></app-button>
  <app-list [updatedList]="useridList"></app-list>
</div>
